    data: |
      SELECT - - col1 / - - col1 + + col1 + - col0 + - - 93 * ( - + 70 ) * + + col1 - - col1 AS col1 FROM tab1 (FORMAT parquet) WHERE NOT + - 64 >= NULL;
  - name: tab1

outputs:
  - name: q11655.out
    data: |
